def my_func(input1: str):
    if not (1 <= len(input1) <= 100):
        return ""
    max_char = ""
    max_count = 0
    for char in set(input1):
        count = input1.count(char)
        if count > max_count or (count == max_count and char < max_char):
            max_char = char
            max_count = count
    return max_char
